import React, { useState } from 'react';
import { Box, Button, Typography, Card, CardContent, TextField, Snackbar, Alert } from '@mui/material';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

export default function Login() {
  const navigate = useNavigate();
  const [form, setForm] = useState({ email: '', senha: '' });
  const [snackbar, setSnackbar] = useState({ open: false, message: '', severity: 'info' });
  const [loading, setLoading] = useState(false);

  const handleChange = e => setForm({ ...form, [e.target.name]: e.target.value });

  const handleSubmit = async e => {
    e.preventDefault();
    setLoading(true);
    try {
      const res = await axios.post('http://localhost:5000/api/auth/login', form);
      localStorage.setItem('token', res.data.token);
      localStorage.setItem('user', JSON.stringify(res.data.user));
      setSnackbar({ open: true, message: 'Login realizado com sucesso!', severity: 'success' });
      setTimeout(() => navigate('/app'), 1000);
    } catch (err) {
      setSnackbar({ open: true, message: err.response?.data?.error || 'Erro ao fazer login.', severity: 'error' });
    } finally {
      setLoading(false);
    }
  };

  return (
    <Box sx={{ minHeight: '100vh', display: 'flex', alignItems: 'center', justifyContent: 'center', background: 'none' }}>
      <Card sx={{ p: { xs: 3, sm: 5 }, borderRadius: 6, boxShadow: '0 8px 32px 0 #0006', minWidth: 320, maxWidth: 400, background: 'rgba(30,34,44,0.96)', backdropFilter: 'blur(10px)', transition: 'box-shadow 0.2s' }}>
        <CardContent>
          <Typography variant="h4" fontWeight={800} color="#fff" align="center" mb={3} sx={{ letterSpacing: 1 }}>
            Login
          </Typography>
          <Box component="form" onSubmit={handleSubmit} display="flex" flexDirection="column" gap={2} mt={2}>
            <TextField label="E-mail" name="email" type="email" value={form.email} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff', background: '#23272f', borderRadius: 2, fontSize: 17 }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2, fontWeight: 500 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <TextField label="Senha" name="senha" type="password" value={form.senha} onChange={handleChange} required fullWidth variant="filled" sx={{ input: { color: '#fff', background: '#23272f', borderRadius: 2, fontSize: 17 }, label: { color: '#b0b8c1' }, background: '#23272f', borderRadius: 2, fontWeight: 500 }} InputLabelProps={{ style: { color: '#b0b8c1' } }} />
            <Button type="submit" variant="contained" size="large" sx={{ borderRadius: 4, fontWeight: 800, fontSize: 20, py: 2, background: 'linear-gradient(90deg, #1976d2 60%, #0d47a1 100%)', boxShadow: '0 2px 16px 0 #1976d2aa', letterSpacing: 1, mt: 2, transition: 'all 0.2s', '&:hover': { background: 'linear-gradient(90deg, #2196f3 60%, #1976d2 100%)', boxShadow: '0 4px 32px 0 #2196f3cc', transform: 'scale(1.03)' } }} disabled={loading}>
              {loading ? 'Entrando...' : 'Entrar'}
            </Button>
            <Button variant="text" sx={{ color: '#b0b8c1', fontWeight: 500, fontSize: 15, letterSpacing: 1, mt: 1, '&:hover': { color: '#1976d2', textDecoration: 'underline' } }} onClick={() => navigate('/')}>Voltar</Button>
          </Box>
        </CardContent>
      </Card>
      <Snackbar open={snackbar.open} autoHideDuration={2500} onClose={() => setSnackbar({ ...snackbar, open: false })} anchorOrigin={{ vertical: 'bottom', horizontal: 'center' }}>
        <Alert severity={snackbar.severity} sx={{ width: '100%' }}>
          {snackbar.message}
        </Alert>
      </Snackbar>
    </Box>
  );
}
